fun Stepper(scrollState: ScrollState = rememberScrollState(1), currentStep: MutableState<Int> = remember { mutableStateOf(0) }, steps: List<Step>, nextButton: () -> Unit? = {
    Button(onClick = {
      if (currentStep.value < steps.size) {
        steps.getOrNull(currentStep.value)?.state?.value = COMPLETE
        currentStep.value = currentStep.value + 1
      }
    }) { Text("Next".uppercase()) }
  }, previousButton: () -> Unit? = {
    TextButton(onClick = {
      if(currentStep.value > 0) {
        steps.getOrNull(currentStep.value)?.state?.value = TODO
        currentStep.value = currentStep.value - 1
      }
    }) { Text("Cancel".uppercase(), color = Color.Gray) }
  })

